import React from "react";
    
import { Typography } from "@material-tailwind/react";
    
export default function Footer() {

  return (
    <footer className="bg-gray-900 text-gray-100">
       <div className="container flex flex-col items-center px-4 py-10 mx-auto md:flex-row md:justify-between">

          {/* Logo y Derechos */}
          <div className="flex flex-wrap mb-4 md:mb-0">
             <img src="logo.svg"  className="h-6 mr-3"/>
            
             <p className="self-center text-sm">
               © 2023 Todos los Derechos Reservados
             </p>
          </div>

          {/* Menú */}
          <div className="flex flex-wrap gap-4">
            <Typography as="a" href="#" className="hover:text-indigo-500">Acerca de</Typography>  
            <Typography as="a" href="#" className="hover:text-indigo-500">Contáctanos</Typography>
          </div>
           
       </div>
    </footer>
  );
}
